            END IF;

            IF((OLD.archived is NULL and NEW.archived is not Null)
            or(OLD.archived is not NULL and NEW.archived is Null)
            or (OLD.archived <> NEW.archived)) THEN
            SELECT INTO pk NEXTVAL('audit_log_event_audit_id_seq');
