--
-- Name: study_subject_detail_trigger(); Type: FUNCTION; Schema: s_02052020test; Owner: clinica
--

CREATE FUNCTION s_02052020test.study_subject_detail_trigger() RETURNS trigger
    LANGUAGE plpgsql
    AS $$DECLARE
			pk INTEGER;
			entity_name_value TEXT;
			updateid INT;

			BEGIN
			SELECT INTO updateid ss.update_id from study_subject ss where ss.study_subject_id=NEW.study_subject_id;

			IF (TG_OP = 'INSERT') THEN
				/*---------------*/
				 /*Study subject Detail created*/

			IF(NEW.first_name  IS NOT NULL) THEN
			/*first name value captured*/
			SELECT INTO pk NEXTVAL('audit_log_event_audit_id_seq');
			SELECT INTO entity_name_value 'Participant First Name';
			INSERT INTO audit_log_event(audit_id, audit_log_event_type_id, audit_date, user_id, audit_table, entity_id, entity_name, old_value, new_value)
			VALUES (pk, '44', now(), updateid, 'study_subject', NEW.study_subject_id, entity_name_value, null, NEW.first_name);
			END IF;

			IF(NEW.email  IS NOT NULL) THEN
			/*email value captured*/
			SELECT INTO pk NEXTVAL('audit_log_event_audit_id_seq');
			SELECT INTO entity_name_value 'Participant Email Address';
			INSERT INTO audit_log_event(audit_id, audit_log_event_type_id, audit_date, user_id, audit_table, entity_id, entity_name, old_value, new_value)
			VALUES (pk, '47', now(), updateid, 'study_subject', NEW.study_subject_id, entity_name_value, null, NEW.email);
			END IF;

			IF(NEW.phone  IS NOT NULL) THEN
			/*phone number value captured*/
			SELECT INTO pk NEXTVAL('audit_log_event_audit_id_seq');
			SELECT INTO entity_name_value 'Participant Phone Number';
			INSERT INTO audit_log_event(audit_id, audit_log_event_type_id, audit_date, user_id, audit_table, entity_id, entity_name, old_value, new_value)
			VALUES (pk, '50', now(), updateid, 'study_subject', NEW.study_subject_id, entity_name_value, null, NEW.phone);
			END IF;

			IF(NEW.last_name  IS NOT NULL) THEN
			/*last name value captured*/
			SELECT INTO pk NEXTVAL('audit_log_event_audit_id_seq');
			SELECT INTO entity_name_value 'Participant Last Name';
			INSERT INTO audit_log_event(audit_id, audit_log_event_type_id, audit_date, user_id, audit_table, entity_id, entity_name, old_value, new_value)
			VALUES (pk, '53', now(), updateid, 'study_subject', NEW.study_subject_id, entity_name_value, null, NEW.last_name);
			END IF;

			IF(NEW.identifier  IS NOT NULL) THEN
			/*identifier value captured*/
			SELECT INTO pk NEXTVAL('audit_log_event_audit_id_seq');
			SELECT INTO entity_name_value 'Participant Identifier';
			INSERT INTO audit_log_event(audit_id, audit_log_event_type_id, audit_date, user_id, audit_table, entity_id, entity_name, old_value, new_value)
			VALUES (pk, '56', now(), updateid, 'study_subject', NEW.study_subject_id, entity_name_value, null, NEW.identifier);
			END IF;

			RETURN NULL; /*return values ignored for 'after' triggers*/



			ELSIF (TG_OP = 'UPDATE') THEN

			/*Study subject Detail Updated */

			IF( (OLD.first_name IS NULL and NEW.first_name IS NOT NULL)  OR (OLD.first_name IS NOT NULL and NEW.first_name IS NULL)  OR OLD.first_name <> NEW.first_name) THEN
			/*first name value changed*/
			SELECT INTO pk NEXTVAL('audit_log_event_audit_id_seq');
			SELECT INTO entity_name_value 'Participant First Name';
			INSERT INTO audit_log_event(audit_id, audit_log_event_type_id, audit_date, user_id, audit_table, entity_id, entity_name, old_value, new_value)
			VALUES (pk, '44', now(), updateid, 'study_subject', NEW.study_subject_id, entity_name_value, OLD.first_name, NEW.first_name);
			END IF;

			IF( (OLD.email IS NULL and NEW.email IS NOT NULL)  OR (OLD.email IS NOT NULL and NEW.email IS NULL)  OR OLD.email <> NEW.email) THEN
			/*email value changed*/
			SELECT INTO pk NEXTVAL('audit_log_event_audit_id_seq');
			SELECT INTO entity_name_value 'Participant Email Address';
			INSERT INTO audit_log_event(audit_id, audit_log_event_type_id, audit_date, user_id, audit_table, entity_id, entity_name, old_value, new_value)
			VALUES (pk, '47', now(), updateid, 'study_subject', NEW.study_subject_id, entity_name_value, OLD.email, NEW.email);
			END IF;

			IF( (OLD.phone IS NULL and NEW.phone IS NOT NULL)  OR (OLD.phone IS NOT NULL and NEW.phone IS NULL)  OR OLD.phone <> NEW.phone) THEN
			/*Phone number value changed*/
			SELECT INTO pk NEXTVAL('audit_log_event_audit_id_seq');
			SELECT INTO entity_name_value 'Participant Phone Number';
			INSERT INTO audit_log_event(audit_id, audit_log_event_type_id, audit_date, user_id, audit_table, entity_id, entity_name, old_value, new_value)
			VALUES (pk, '50', now(), updateid, 'study_subject', NEW.study_subject_id, entity_name_value, OLD.phone, NEW.phone);
			END IF;

			IF( (OLD.last_name IS NULL and NEW.last_name IS NOT NULL)  OR (OLD.last_name IS NOT NULL and NEW.last_name IS NULL)  OR OLD.last_name <> NEW.last_name) THEN
			/*last name value changed*/
			SELECT INTO pk NEXTVAL('audit_log_event_audit_id_seq');
			SELECT INTO entity_name_value 'Participant Last Name';
			INSERT INTO audit_log_event(audit_id, audit_log_event_type_id, audit_date, user_id, audit_table, entity_id, entity_name, old_value, new_value)
			VALUES (pk, '53', now(), updateid, 'study_subject', NEW.study_subject_id, entity_name_value, OLD.last_name, NEW.last_name);
			END IF;

			IF( (OLD.identifier IS NULL and NEW.identifier IS NOT NULL)  OR (OLD.identifier IS NOT NULL and NEW.identifier IS NULL)  OR OLD.identifier <> NEW.identifier) THEN
			/*identifier value changed*/
			SELECT INTO pk NEXTVAL('audit_log_event_audit_id_seq');
			SELECT INTO entity_name_value 'Participant Identifier';
			INSERT INTO audit_log_event(audit_id, audit_log_event_type_id, audit_date, user_id, audit_table, entity_id, entity_name, old_value, new_value)
			VALUES (pk, '56', now(), updateid, 'study_subject', NEW.study_subject_id, entity_name_value, OLD.identifier, NEW.identifier);
			END IF;


			RETURN NULL;  /*return values ignored for 'after' triggers*/
			END IF;
		END;
		$$;


ALTER FUNCTION s_02052020test.study_subject_detail_trigger() OWNER TO clinica;

--
-- Name: study_subject_trigger(); Type: FUNCTION; Schema: s_02052020test; Owner: clinica
--

CREATE FUNCTION s_02052020test.study_subject_trigger() RETURNS trigger
    LANGUAGE plpgsql
    AS $$DECLARE
            pk INTEGER;
            entity_name_value TEXT;
            old_unique_identifier TEXT;
            new_unique_identifier TEXT;

            BEGIN
            IF (TG_OP = 'INSERT') THEN
            /*---------------*/
            /*Study subject created*/
            SELECT INTO pk NEXTVAL('audit_log_event_audit_id_seq');
            INSERT INTO audit_log_event(audit_id, audit_log_event_type_id, audit_date, user_id, audit_table, entity_id)
            VALUES (pk, '2', now(), NEW.owner_id, 'study_subject', NEW.study_subject_id);
            RETURN NULL; /*return values ignored for 'after' triggers*/
            /*---------------*/
            ELSIF (TG_OP = 'UPDATE') THEN
            IF(OLD.status_id <> NEW.status_id) THEN
            /*---------------*/
            /*Study subject status changed*/
            SELECT INTO pk NEXTVAL('audit_log_event_audit_id_seq');
            SELECT INTO entity_name_value 'Status';
            INSERT INTO audit_log_event(audit_id, audit_log_event_type_id, audit_date, user_id, audit_table, entity_id, entity_name, old_value, new_value)
            VALUES (pk, '3', now(), NEW.update_id, 'study_subject', NEW.study_subject_id, entity_name_value, OLD.status_id, NEW.status_id);
            /*---------------*/
            END IF;

            IF(OLD.label <> NEW.label) THEN
            /*---------------*/
            /*Study subject value changed*/
            SELECT INTO pk NEXTVAL('audit_log_event_audit_id_seq');
            SELECT INTO entity_name_value 'Participant ID';
            INSERT INTO audit_log_event(audit_id, audit_log_event_type_id, audit_date, user_id, audit_table, entity_id, entity_name, old_value, new_value)
            VALUES (pk, '4', now(), NEW.update_id, 'study_subject', NEW.study_subject_id, entity_name_value, OLD.label, NEW.label);
            /*---------------*/
            END IF;

            IF(OLD.secondary_label <> NEW.secondary_label) THEN
            /*---------------*/
            /*Study subject value changed*/
            SELECT INTO pk NEXTVAL('audit_log_event_audit_id_seq');
            SELECT INTO entity_name_value 'Secondary Subject ID';
            INSERT INTO audit_log_event(audit_id, audit_log_event_type_id, audit_date, user_id, audit_table, entity_id, entity_name, old_value, new_value)
            VALUES (pk, '4', now(), NEW.update_id, 'study_subject', NEW.study_subject_id, entity_name_value, OLD.secondary_label, NEW.secondary_label);
            /*---------------*/
            END IF;

            IF(OLD.enrollment_date <> NEW.enrollment_date) THEN
            /*---------------*/
            /*Study subject value changed*/
            SELECT INTO pk NEXTVAL('audit_log_event_audit_id_seq');
            SELECT INTO entity_name_value 'Enrollment Date';
            INSERT INTO audit_log_event(audit_id, audit_log_event_type_id, audit_date, user_id, audit_table, entity_id, entity_name, old_value, new_value)
            VALUES (pk, '4', now(), NEW.update_id, 'study_subject', NEW.study_subject_id, entity_name_value, OLD.enrollment_date, NEW.enrollment_date);
            /*---------------*/
            END IF;

            IF(OLD.study_id <> NEW.study_id) THEN
            /*---------------*/
            /*Subject reassigned*/
            SELECT INTO pk NEXTVAL('audit_log_event_audit_id_seq');
            SELECT INTO entity_name_value 'Study id';
            SELECT INTO old_unique_identifier study.unique_identifier FROM study study WHERE study.study_id = OLD.study_id;
            SELECT INTO new_unique_identifier study.unique_identifier FROM study study WHERE study.study_id = NEW.study_id;
            INSERT INTO audit_log_event(audit_id, audit_log_event_type_id, audit_date, user_id, audit_table, entity_id, entity_name, old_value, new_value)
            VALUES (pk, '27', now(), NEW.update_id, 'study_subject', NEW.study_subject_id, entity_name_value, old_unique_identifier, new_unique_identifier);
            /*---------------*/
            END IF;

            RETURN NULL;  /*return values ignored for 'after' triggers*/
            END IF;
            END;
            $$;


ALTER FUNCTION s_02052020test.study_subject_trigger() OWNER TO clinica;

--
-- Name: subject_group_assignment_trigger(); Type: FUNCTION; Schema: s_02052020test; Owner: clinica
--

CREATE FUNCTION s_02052020test.subject_group_assignment_trigger() RETURNS trigger
    LANGUAGE plpgsql
    AS $$DECLARE
            pk INTEGER;
            group_name TEXT;
            old_group_name TEXT;
            new_group_name TEXT;
            study_group_class_name TEXT;
            BEGIN
            IF (TG_OP = 'INSERT') THEN
            SELECT INTO pk NEXTVAL('audit_log_event_audit_id_seq');
            SELECT INTO group_name sg.name FROM study_group sg WHERE sg.study_group_id = NEW.study_group_id;
            SELECT INTO study_group_class_name sgc.name FROM study_group sg join study_group_class sgc ON sg.study_group_class_id = sgc.study_group_class_id WHERE sg.study_group_id = NEW.study_group_id ;
            INSERT INTO audit_log_event(audit_id, audit_log_event_type_id, audit_date, user_id, audit_table, entity_id, entity_name, old_value, new_value)
            VALUES (pk, '28', now(), NEW.owner_id, 'subject_group_map', NEW.study_subject_id, study_group_class_name,'', group_name);
            END IF;
            IF (TG_OP = 'UPDATE') THEN
            IF(OLD.study_group_id <> NEW.study_group_id) THEN
            SELECT INTO pk NEXTVAL('audit_log_event_audit_id_seq');
            SELECT INTO old_group_name sg.name FROM study_group sg WHERE sg.study_group_id = OLD.study_group_id;
            SELECT INTO new_group_name sg.name FROM study_group sg WHERE sg.study_group_id = NEW.study_group_id;
            SELECT INTO study_group_class_name sgc.name FROM study_group sg join study_group_class sgc ON sg.study_group_class_id = sgc.study_group_class_id WHERE sg.study_group_id = NEW.study_group_id ;
            INSERT INTO audit_log_event(audit_id, audit_log_event_type_id, audit_date, user_id, audit_table, entity_id, entity_name, old_value, new_value)
            VALUES (pk, '29', now(), NEW.update_id, 'subject_group_map', NEW.study_subject_id, study_group_class_name,old_group_name, new_group_name);
            END IF;
            RETURN NULL;  /*return values ignored for 'after' triggers*/
            END IF;
            RETURN NULL;
            END;$$;


